import React from "react";

const InfoPage = () => {
  return (
    <div className="info-container">
      <h1>Informații adiționale</h1>

      <h2>Pneuri</h2>
      <p>Există patru tipuri principale de pneuri utilizate în Formula 1: soft, medium, hard și pneuri pentru ploaie (inters și wet).</p>
      <img src="/images/tires.png" alt="Pneuri" />

      <h2>Condiții Meteo</h2>
      <p>Performanța mașinii este afectată semnificativ de condițiile meteo. Pe ploaie, viteza scade considerabil.</p>
      <img src="/images/weather.jpg" alt="Condiții Meteo" />

      <h2>Downforce</h2>
      <p>Downforce-ul afectează aderența și viteza. Un downforce ridicat oferă o aderență mai mare, dar reduce viteza maximă.</p>
      <img src="/images/downforce.jpg" alt="Downforce" />

      <h2>Circuite</h2>
      <p>Fiecare circuit are un caracter unic, influențat de lungime, viraje și zone DRS.</p>
      <img src="/images/circuit.png" alt="Circuit" />
    </div>
  );
};

export default InfoPage;
